import React, { useEffect } from "react";
import { useLocation, useParams } from "react-router-dom";
import './Weather.css';

const Weather = () => {
    const {id}= useParams();
    const location = useLocation();
    console.log(location);

    const finalData = [];

    const checkId = (id) => {
        location.state.data.map((item) => {
            if (id == item.id) {
                console.log('found');
                finalData.push(item);
                console.log(item);
            }
            else {
                console.log('Not found');
            }
        })
    }

    useEffect(
        () => {
            checkId(id);
        }
    ,[]);

    return (
        <div>
          {finalData.map((item) => {
            return (
                <div className="finalWeatherWrapper">
                    <div className="finalDayWrapper">
                        {item.day}
                    </div>
                    <div className="finalDegreeWrapper">
                        {item.degrees}
                    </div>
                    <div className="finalStatusWrapper">
                        {item.status}
                    </div>
                </div>
            );
          })}
        </div>
    );
}

export default Weather;
